import React, {Component} from 'react';
import { Header} from '../../components'
import { MyPokemonList} from '../../containers'

class MyPokemon extends Component {
    render(){
        return (
            <>
                <Header 
                    leftAction='/'
                    title='My Pokemon'
                />
                <MyPokemonList/>
            </>
        )
    }

}

export default MyPokemon;
